A goal is personal and it's something you should encourage yourself with. Setting something realistic is vital when making progress. Whether its a fitness, weight or nutrition related goal make sure you break it down to make it achievable. Once you've set it, say it aloud, write in on a sticker, put a reminder in your calendar and feel free to change it as you go forward. I've listed some examples below. 
- Workout for 30 minutes 4 times a week (cardio * 2 and strength * 2)
- Try to lose 7 pounds in 2 months (1 pound a week)

#2 Get some new gear
While there is no need to splash out on tons of expensive gear, a new pair of trainers, a water bottle or leggings can spice up your workouts; making you feel ready to smash each session! After all, you’ll have an excuse to show them off.

#3 Make time for your workouts 
When I was busy in my marketing role, I would put my workouts in my diary and treat them like a standing appointment. Remember it’s time for you to destress because your health and wellbeing is a priority.

#4 Find a workout partner
Though a 5k run might not be your bestie's idea of a fun time, a fitness class, hike or cycle may be. Having a workout partner, whoever that may be, encourages you to pursue the activity as you'll be less likely to drop out. It'll be fun, engaging and it gives you a chance to socialise whilst achieving your fitness goal.

#5 It’s the little things that count 
Whether you’re working out once a week or training for a half marathon, take little steps to increase your activity. A few little steps will eventually transform your entire routine. 

#6 Measure progress in the right way for you!
Are you finding that your jeans are a bit snug? Or maybe the walk to the train station is getting you puffed out? Well, your goal can be anything that you strive to achieve and how you measure it is just as important. You could do weekly weigh ins, measurements, recording your PBs or even progress photos.

